import React from 'react';
import Category from "./Category";
import  cards from "../../../image/cards.svg"
import  doc from "../../../image/doc.svg"
import  chat from "../../../image/chat.svg"
import  phone from "../../../image/phone.svg"
const Cartegories = () => {
    const margin = {
        width: "2%"
    }
    return (
        <div className="row">
            <Category  pathToImage={cards} text="common"></Category>
            <div style={margin}></div>
            <Category pathToImage={doc} text="common"></Category>
            <div style={margin}></div>
            <Category pathToImage={chat} text="common"></Category>
            <div style={margin}></div>
            <Category pathToImage={phone} text="common"></Category>
        </div>
    );
};

export default Cartegories;
